const app = getApp()

Page({
  data: {
    newImgSrc :"data:image/png;base64,",
  },
  onLoad() {
    console.log('代码片段是一种迷你、可分享的小程序或小游戏项目，可用于分享小程序和小游戏的开发经验、展示组件和 API 的使用、复现开发问题和 Bug 等。可点击以下链接查看代码片段的详细文档：')
    console.log('https://mp.weixin.qq.com/debug/wxadoc/dev/devtools/devtools.html')
    
    //保存文件到相册
    //线上项目调用此方法<部分机型>不进入 wx.saveImageToPhotosAlbum回调函数
    //代码片段<部分机型>真机调试 可以正常保存,这是为什么?可能跟手机上的小程序缓存有关吗?

    this.saveImage();
  
  },saveImage: function() { 
    const that = this;
    
    var qrcode = that.data.newImgSrc ;//base64图片
  
    const fs = wx.getFileSystemManager();
    //随机定义路径名称
    var times = new Date().getTime();
    var codeimg = wx.env.USER_DATA_PATH + '/' + times + '.png';
    var img = qrcode.replace("data:image/png;base64,", "");
     
    fs.writeFile({
      filePath: codeimg,//临时路径
      data: wx.base64ToArrayBuffer(img) ,//base64
      encoding: 'base64',
      success: function(res){  
        //临时文件写入成功 将临时文件保存至相册
        console.log(res)
        wx.saveImageToPhotosAlbum({
          filePath: codeimg,//
          success: function (data) { 
            //..
            console.log(data)
          },
          fail: function (err) {
            //..
            console.log(err)
          }
        })

      },fail: function(e){
        console.log(e);
      }
    });
  
 
  },
})
